// Case sources: http://www.turkupetcentre.net/reports/tpcmod0020_app_a.pdf
func TestNNLS1(t *testing.T) {
	tests := []struct {
		name      string
		m, n, mda int
		a, b, x   []float64
	}{
		{"2-parameter estimation", 4, 2, 4,
			[]float64{
				1, 2, 3, 4,
				1, 4, 9, 16},
			[]float64{0.6, 2.2, 4.8, 8.4},
			[]float64{0.1, 0.5}},
		{"3-parameter estimation", 4, 3, 5,
			[]float64{
				1, 2, 3, 4, math.NaN(),
				1, 4, 9, 16, math.NaN(),
				1, 8, 27, 64, math.NaN()},
			[]float64{0.73, 3.24, 8.31, 16.72},
			[]float64{0.1, 0.5, 0.13}},
		{"4-parameter estimation, where the fourth parameter is zero.", 4, 4, 4,
			[]float64{
				1, 2, 3, 4,
				1, 4, 9, 16,
				1, 8, 27, 64,
				1, 16, 81, 256},
			[]float64{0.73, 3.24, 8.31, 16.72},
			[]float64{0.1, 0.5, 0.13, 0}},
		{"3-parameter estimation, where the second parameter is zero.", 4, 3, 5,
			[]float64{
				1, 2, 3, 4, math.NaN(),
				1, 4, 9, 16, math.NaN(),
				1, 8, 27, 64, math.NaN()},
			[]float64{0.23, 1.24, 3.81, 8.72},
			[]float64{0.1, 0, 0.13}},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			x := make([]float64, tt.n)
			w := make([]float64, tt.n)
			z := make([]float64, tt.m)
			i := make([]int, tt.n)
			norm, mode := NNLS(tt.m, tt.n, tt.a, tt.mda, tt.b, x, w, z, i, 30)
			if mode != HasSolution {
				t.Fatal("NNLS no solution")
			}
			// norm should near zero
			if norm > 1e-14 {
				t.Fatal("NNLS residual norm error")
			}

			zeros := slices.Repeat([]float64{zero}, len(w))
			if !almostEqual(zeros, w, 1e-14) {
				t.Fatal("NNLS dual vector unexpected")
			}
			if !almostEqual(tt.x, x, 1e-14) {
				t.Fatal("NNLS solution unexpected")
			}
		})
	}

}

